import React from "react";
import Container from "@material-ui/core/Container";

const BoxContent = () => {
  return (
    <>
      <Container style={{ padding: "2rem 0rem", color: "#000" }}>
        <p>
          Overview This game show sees contestants solve word puzzles, similar
          to those used in Hangman, to win cash and prizes determined by
          spinning a giant carnival wheel.
        </p>
      </Container>
    </>
  );
};

export default BoxContent;
